import React from 'react';


class Noteboard extends React.Component {
    // handleClick(i) {
    //     console.log("value="+i.target.value);
    // }


    render() {
        const allnotes = this.props.notes;
        const listItems = allnotes.map((note) =>
            <button value={note} key={note} onClick={(note) => this.props.onClick(note)}>{note}</button>
            );
        return (
            <div>{listItems}
            </div>
          );
    }
}

export default Noteboard;



